import { DogCanvas } from "../dog-canvas";
import { DogEntry } from "../dog-entry";
import { saveAs } from "file-saver";


export class DogsService {
  private dogPics : DogCanvas[] = [];
  private id = 2;
  dogs: DogEntry[] = [{id : 0, name : "side-eye", image:"data:image/png;base64,"},{id: 1, name: "surprise", image:"data:image/png;base64,"}];


  addDog(name:string, image:string) {
    this.dogs.push({id : this.id, name: name, image: image});
    this.id += 1;
  }


}